import React from "react";
import styled from 'styled-components';
import Sidebar from "../Components/Sidebar";

const MakemainPositioner = styled.div`
  display: flex;
`;
// 출력폼
const Makemain1 = styled.div`
  border-style: solid;
  width: 50%;
  height: 100vh;
  margin-top: 1rem;
`;

// 입력폼
const Makemain2 = styled.div`
  border-style: solid;
  width: 50%;
  height: 100vh;
  margin-top: 1rem;
`;

const Cololselector = styled.div`
  display: flex;
  justify-content: center;
`;

function Myspace() {
  return (
    <MakemainPositioner>
      <Sidebar />
      <Makemain1> 안녕 </Makemain1>
      <Makemain2> 
        <Cololselector>
        명함 컬러 선택하기
        </Cololselector>
      </Makemain2>
    </MakemainPositioner>
  );
}

export default Myspace;
